// Quiz.js

import React from 'react';
import './Quiz.css';

function Quiz({ navigateTo }) {
  return (
    <div className="quiz-page">
      <div className="quiz-header">
        <a href="/" className="home-title-link">
          <h1 onClick={() => navigateTo('home')}>HAIR HAVEN</h1>
        </a>
        <nav className="quiz-menu">
          <ul>
            <li><a href="#products" onClick={() => navigateTo('products')}>PRODUCTS</a></li>
            <li>
              <div className="dropdown">
                <a href="#shop-by-concern">SHOP BY CONCERN</a>
                {/* Add your concern dropdown content here */}
              </div>
            </li>
            <li>
              <div className="dropdown">
                <a href="#shop-by-hair-type">SHOP BY HAIR TYPE</a>
                {/* Add your hair type dropdown content here */}
              </div>
            </li>
            <li><a href="#quiz">QUIZ</a></li>
          </ul>
        </nav>
      </div>
      {/* Add your quiz content here */}
    </div>
  );
}

export default Quiz;
